import React, { Component } from "react";
import styled from "styled-components";
import Header1 from "../components/Header1";
import Header2 from "../components/Header2";

const Container = styled.div`
  /* display: flex; */
`;

const Heading = styled.h2`
    display: flex;
`;

const Form = styled.form`
    /* display: flex; */
    /* flex-direction: column; */
`;

const Tr = styled.tr`
    /* display: flex; */
`;

const Td = styled.td`
    /* display: flex; */
`;

class SignupPage extends Component {
    render() {
        return(
            <Container>
                <Header1 />
                <Header2 />
                <Heading>Enter Book Details : </Heading>
                <Form action="">
                    <Table></Table>
                    <Tr>
                        <Td><label htmlFor="username">Full Name</label></Td>
                        <Td><input type="text" name="username" placeholder="Enter Full Name" id="username" /></Td>
                    </Tr>
                    <Tr>
                        <Td><label htmlFor="email">Email</label></Td>
                        <Td><input type="text" name="email" placeholder="Enter Email ID" id="email" /></Td>
                    </Tr>
                    <Tr>
                        <Td><label htmlFor="phone">Phone</label></Td>
                        <Td><input type="text" name="phone" placeholder="Enter Phone number" id="phone" /></Td>
                    </Tr>
                    <Tr>
                        <Td><label htmlFor="password">Password</label></Td>
                        <Td><input type="text" name="password" placeholder="Enter Password" id="password" /></Td>
                    </Tr>
                </Form>
            </Container>
        )
    }
}

export default SignupPage;
